INSERT INTO `wash` VALUES (1,'/images/wash1.png',NULL,'Machine Wash, Normal','Garment may be laundered through the use of hottest available water, detergent or soap, agitation, and a machine designed for this purpose.','2018-02-12 16:28:35.568','2018-02-12 16:28:35.568'),(2,'/images/wash2_1.png','/images/wash2_2.png','Machine Wash, Cold','Initial water temperature should not exceed 30C or 65 to 85F.','2018-02-12 16:28:35.568','2018-02-12 16:28:35.568'),(3,'/images/wash3_1.png','/images/wash3_2.png','Machine Wash, Warm','Initial water temperature should not exceed 40C or 105F.','2018-02-12 16:28:35.568','2018-02-12 16:28:35.568'),(4,'/images/wash4_1.png','/images/wash4_2.png','Machine Wash, Hot','Initial water temperature should not exceed 50C or 120F.','2018-02-12 16:28:35.568','2018-02-12 16:28:35.568'),(5,'/images/wash5_1.png','/images/wash5_2.png','Machine Wash, Hot','Initial water temperature should not exceed 60C or 140F.','2018-02-12 16:28:35.568','2018-02-12 16:28:35.568'),(6,'/images/wash6_1.png','/images/wash6_2.png','Machine Wash, Hot','Initial water temperature should not exceed 70C or 160F.','2018-02-12 16:28:35.568','2018-02-12 16:28:35.568'),(7,'/images/wash7_1.png','/images/wash7_2.png','Machine Wash, Hot','Initial water temperature should not exceed 95C or 200F.','2018-02-12 16:28:35.568','2018-02-12 16:28:35.568'),(8,'/images/wash8.png',NULL,'Machine Wash, Permanent Press','Garment may be machine laundered only on the setting designed to preserve Permanent Press with cool down or cold rinse prior to reduced spin.','2018-02-12 16:28:35.568','2018-02-12 16:28:35.568'),(9,'/images/wash9.png',NULL,'Machine Wash, Gentle or Delicate','Garment may be machine laundered only on the setting designed for gentle agitation and/or reduced time for delicate items.','2018-02-12 16:28:35.568','2018-02-12 16:28:35.568'),(10,'/images/wash10.png',NULL,'Hand Wash','Garment may be laundered through the use of water, detergent or soap and gentle hand manipulation.','2018-02-12 16:28:35.568','2018-02-12 16:28:35.568'),(11,'/images/wash11.png',NULL,'Do Not Wash','Just do not wash!','2018-02-12 16:28:35.568','2018-02-12 16:28:35.568');
